import ExpenseItem from "./ExpenseItem";

function Expenses(props){

    const {title1, amount1, date1} = props[Object.keys(props)[0]];

    return (
    <div>
     <ExpenseItem   
        title={title1}
        amount={amount1}
        date={date1}
        />
     

        
    </div>
    );
}

export default Expenses;
